import React from 'react';
import '../../App.css';

export default function Services() {
  return <div className='services'><div className="google-map-code">
  <iframe src="https://www.google.com/maps/dir/46.3593814,25.5179241/45.0642119,25.3498524/@45.7006123,24.9835493,9z/data=!3m1!4b1!4m4!4m3!1m1!4e1!1m0" width="600" height="450" frameborder="0" style={{border:0}} allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>
</div></div>;
}
